import { Modal, ModalOverlay } from "@chakra-ui/react";

const AddFriendModal = ({ isOpen, onClose }) => {
  return (
    <Modal isOpen={isOpen}>
      <ModalOverlay />
    </Modal>
  );
};

export default AddFriendModal;
